messages.content:
@everyone Als barverantwoordelijke neem ik de taak op mij om te zagen over de toog :) Ik denk dat het algemeen wel geapprecieerd zal worden als elke keer dat je de laatste shift draait, je de frigo's op het einde van je shift bijvult. Bespaart werk voor de volgende + dan is de drank direct koud om te serveren, want zoals iedereen weet: warmen Duvel is bucht.
Graag ook jullie groot vuilnis dat niet in de vuilzak past (bv. pizzadozen) buiten bij het karton te zetten ipv in de kelder te ditchen.
Thanks for coming to my TED talk xxx
